import React from 'react'

const HomePage = () => {
    const [formData, setFormData] = useState({
        symbol_name : ''
      });
    
      const handleChange = (e) => {
        setFormData({ ...formData, [e.target.name]: e.target.value });
      };
    
      const handleSubmit = async (e) => {
        e.preventDefault();
        try {
          const response = await axios.post('/user/register/', formData);
          console.log(response.data);
          // Handle successful registration, maybe redirect to login page
        } catch (error) {
          console.error(error.response.data);
          // Handle registration error, maybe display error message
        }
      };
    
      return (
        <div>
          <form onSubmit={handleSubmit}>
            <input type="text" name="symbol_name" value={formData.symbol_name} onChange={handleChange} placeholder=" Add Symbol Name" required />
            <button type="submit">Add Symbol</button>
          </form>
        </div>
      );
};

export default HomePage
